import './App.css';
import ReactDOM from "react-dom/client";
import Home from './components/Home';
import {BrowserRouter, Route, Routes} from 'react-router-dom';
import React, { component } from 'react';
import Protectedroute from './ProtectedRoute';
import { useEffect, useState } from 'react';

// Import the functions you need from the SDKs you need
import { initializeApp } from "firebase/app";
import { getAnalytics } from "firebase/analytics";
// TODO: Add SDKs for Firebase products that you want to use
// https://firebase.google.com/docs/web/setup#available-libraries

// Your web app's Firebase configuration
// For Firebase JS SDK v7.20.0 and later, measurementId is optional
const firebaseConfig = {
  apiKey: "AIzaSyA0c0cwDbXjTEvAIybD-YWjGS5zu-q_OZA",
  authDomain: "personal-website-38d80.firebaseapp.com",
  projectId: "personal-website-38d80",
  storageBucket: "personal-website-38d80.appspot.com",
  messagingSenderId: "636986292371",
  appId: "1:636986292371:web:f1e09a9329ace9f158f566",
  measurementId: "G-VYRHTD6B7Q"
};

// Initialize Firebase
const app = initializeApp(firebaseConfig);
const analytics = getAnalytics(app);

export default function App() {
  return (
    <div>
      <Home/>
    </div>
  );
}
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<App />);
